We first find the inverse function of $f(c)$, which is
\begin{align}
    f^{-1}(c)&=\frac{c}{2}-\frac{3}{2},\\
    f^{-1}(c)\times c\times f(c)&=\frac{c^3}{2},\\
\end{align}
Now we need to find $k,l,m,$ and $n$ such that
\begin{align}
    \frac{kc+l}{mc+n}&=\frac{c^3}{2}.
\end{align}
If we multiply both sides by $2c-3$, we get
\begin{align}
    (2c-3)(kc+l)-(2c-3)(mc+n)&=2c^3-3c^2.
\end{align}
This is a polynomial equation in $c$ of degree two, and can be solved by factoring. We get
\begin{align}
    (2c-3)(kc+l)-(2c-3)(mc+n)&=2c^3-3c^2\implies (2c-3)\left((kc+l)-c^2(mc+n)\right)=3c^2-2c^3.
\end{align}
We can now set this equal to zero and solve for $c$, giving us
\begin{align}
    kc+l-c^2(mc+n)&=0\implies \frac{k}{c}+\frac{l}{c^2}-\frac{m}{c}+\frac{n}{c^3}=0.
\end{align}
We can divide both sides by $c$ to get
\begin{align}
    \frac{k}{c}+\frac{l}{c^2}-\frac{m}{c}+\frac{n}{c^3}&=\frac{k}{c}-\frac{m}{c}+\frac{n}{c^2}=0.
\end{align}
We now solve for $c$ to get
\begin{align}
    \frac{k}{c}-\frac{m}{c}+\frac{n}{c^2}&=0\implies \frac{k+m}{c}-\frac{n}{c^2}=0\implies c=\frac{k+m}{n}.
\end{align}
Finally, we can substitute this into the original expression to get
\begin{align}
    \frac{kn^2}{lm}&=\frac{k+m}{n}.
\end{align}

